import { Button, Table} from 'antd';
import axios from 'axios';
import { useEffect, useState } from 'react';
import url from '../components/host';
import { AiOutlineCheck, AiOutlineClose } from "react-icons/ai";
import "./style/style.css"



const Tables = () => {
  const [setSelectedRowKeys] = useState([]);
  const [setLoading] = useState(false);
  const [data, setdata] = useState([])
  const [data1, setdata1] = useState([])
  const [data2, setdata2] = useState([])
  const [data3, setdata3] = useState([])
  const [data4, setdata4] = useState([])
  const [data5, setdata5] = useState([])
  const [data6, setdata6] = useState([])
  const [data7, setdata7] = useState([])
  const [data8, setdata8] = useState([])
  const [page, setPage] = useState(1)
  const [ keys, setKeys ] = useState([])




  const columns = [
    {
      title: 'Id',
      dataIndex: 'id',
    },
    {
      title: 'Name',
      dataIndex: 'name',
    },
    {
      title: 'Price',
      dataIndex: 'price',
    },
    {
      title: 'Status',
      dataIndex: 'is_active',
      render: (el) => <div className='status'  >{el ? (<h1 style={{ color: "green" }}><AiOutlineCheck /></h1>) : (<h1 style={{ color: "red" }} ><AiOutlineClose className='AiOutlineClose' /></h1>)}</div>


    },
    {
      title: "Ma'lumot",
      key: "edit",
      width: "5%",
      render: (__, item) => {
        return <div><Button onClick={() => { getOneProduct(item) }} style={{ background: 'orange', color: 'white' }} type="text">Ma'lumot</Button></div>
      }
    },
    {
      title: "Edit",
      key: "edit",
      width: "5%",
      render: (key) => {
        return <div><Button onClick={()=>postoyna1(key.id)} style={{ background: 'orange', color: 'white' }} type="danger">O'zgartirish</Button></div>
      }
    },
    {
      title: "Delete",
      key: "delete",
      width: "5%",
      render: (key) => {
        return <div>
          <Button onClick={() => daleteAxiox(key.id)} type="danger">O'chirish</Button>
        </div>

      }
    },
  ];
  const getOneProduct = (item) => {
    setdata(item)
    setPage(2)
    console.log(item);

    setTimeout(() => {  
      document.querySelector(".slect1").value=item.position.id
      document.querySelector(".slect2").value=item.position.series.id
      document.querySelector(".slect3").value=item.position.series.model.id
      document.querySelector(".slect4").value=item.fuel_sort.id
      document.querySelector(".slect5").value=item.gearbox.id
      document.querySelector(".slect6").value=item.garant.id
      document.querySelector(".slect7").value=item.branch.id
      document.querySelector(".slect8").value=item.year
      document.querySelector(".slect9").value=item.distance
      document.querySelector(".slect10").value=item.engine
      document.querySelector(".slect11").value=item.colour
      document.querySelector(".slect12").value=item.name
      document.querySelector(".slect13").value=item.initial_price
      document.querySelector(".slect14").value=item.price
      document.querySelector(".slect15").value=item.sale
      document.querySelector(".slect16").value=item.depozit
      document.querySelector(".slect17").value=item.fuel_consumption
      document.querySelector(".slect18").value=item.description


    }, 1000);

  }

  function getData(id) {
    axios.get(`${url}/api/cars_get/`).then(res => {
      setdata1(res.data)
      setKeys(id)
    })
  }
  useEffect(() => {
    getData()
  }, [])

  useEffect(()=>{
    axios.get(`${url}/api/series_get/`).then(res=>{
      setdata7(res.data)
    }).catch(err=>{
      console.log(err);
    })
  },[])


  useEffect(()=>{
    axios.get(`${url}/api/models/`).then(res=>{
      setdata8(res.data)
    }).catch(err=>{
      console.log(err);
    })
  },[])


  function getFuel() {
    axios.get(`${url}/api/fuel_sort/`).then(res => {
      setdata2(res.data)
    })
  }
  useEffect(() => {
    getFuel()
  }, [])

  function getGear() {
    axios.get(`${url}/api/gear_box/`).then(res => {
      setdata3(res.data)
    })
  }
  useEffect(() => {
    getGear()
  }, [])

  function getGar() {
    axios.get(`${url}/api/garant/`).then(res => {
      setdata4(res.data)
    })
  }
  useEffect(() => {
    getGar()
  }, [])

  function getPosit() {
    axios.get(`${url}/api/position_get/`).then(res => {
      setdata6(res.data)
    })
  }
  useEffect(() => {
    getPosit()
  }, [])

  function getBranch() {
    axios.get(`${url}/api/branch/`).then(res => {
      setdata5(res.data)
    })
  }
  useEffect(() => {
    getBranch()
  }, [])



  function daleteAxiox(id) {
    console.log(id,"slaom");
    axios.delete(`${url}/api/cars/${id}/`, { headers: { 'Authorization': 'Bearer ' + sessionStorage.getItem("token") } }).then(res => {
      alert("ishladi")
      axios.get(`${url}/api/cars/`).then(res => {
        setdata1(res.data)
      })
    }).catch(err => {
      alert("ishlamadi")
    })
  }

  function postoyna() {
    document.querySelector(".postoyna").style = "position:fixed;right:0px;  transition: 1s;"

  }
  function postoynaa() {
    document.querySelector(".postoyna").style = "position:fixed;right:-100%;  transition: 1s;"
  }
  function postoyna1(key) {
    document.querySelector(".postoyna1").style = "position:fixed;right:0;  transition: 1s;"
    setKeys(key)
  }
  function postoynaa1() {
